private String pathToKey(Path path) {
  if (!path.isAbsolute()) {
    path = new Path(workingDir, path);
  }

  if (path.toUri().getScheme() != null && path.toUri().getPath().isEmpty()) {
    return "";
  }

  return path.toUri().getPath().substring(1);
}
